import React from "react";
import "./home.css"

const Home: React.FC = () => {
    return (
        <div className="landing_page_wrapper">
            <h2>Hello! My name is</h2>
            <h1>Jeremy Louie</h1>
            <p>I'm currently building software needed to detect water contaminants in refillable water stations</p>
        </div>
    );
};
export default Home;
